import React from 'react';
import { Stack } from 'react-bootstrap';

const Header = () => {
    return (
        <div>
            <Stack direction="horizontal" gap={3}>
                <ul>
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>
                        <Link to="/about">About</Link>
                    </li>
                    <li>
                        <Link to="/users">Users</Link>
                    </li>
                </ul>
            </Stack>
        </div>
    );
};

export default Header;
